import React from 'react';
import Header from '../Header/Index';
import { Col,Row } from 'antd';
const Index=(props)=> {
    return (
        <div>
            <Row>
                <Col flex={1}></Col>
                <Col flex={2}></Col>
            </Row>
           <Row>
               <Col flex={1}><Header /></Col>
               <Col flex={4}></Col>
           </Row>
        </div>
    );
}

export default Index;
